import axios from 'axios'

export const reqLogin = (usernames, password) => {
  // package.json中配置代理 写服务器的地址  这里
  axios.post("http://localhost:3000/login").then((response) => {
    console.log(response);
  }).catch((err) => {
    console.log(err);
  })
}
